import { Navbar, Nav, NavDropdown, Image } from 'react-bootstrap';
import './component.less';
const NavList = [
  { name: '首页', url: '/' },
  { name: '核心技术', url: '/middle' },
  { name: '智能驾驶', url: '/auto' },
  { name: '新闻中心', url: '/news' },
  { name: '关于我们', url: '/about' },
  { name: '加入我们', url: '/joinus' },
  { name: '开发者社区', url: '/development' },
];
function NavItem() {
  const mounseEnter = (e) => {
    console.log(e, 'eeee');
  };
  return (
    <Nav>
      {NavList.map((item, index) => {
        return (
          <Nav.Link key={index} onMouseEnter={() => mounseEnter} href="#deets">
            {item.name}
          </Nav.Link>
        );
      })}
    </Nav>
  );
}
export default function Header() {
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Navbar.Brand href="#home">
        <Image className="logo" src={'/static/logo2x.png'} fluid />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          {/* <Nav.Link href="#features">Featu</Nav.Link>
          <Nav.Link href="#pricing">Pricing</Nav.Link> */}
        </Nav>
        <NavItem />
      </Navbar.Collapse>
    </Navbar>
  );
}
